import Head from "next/head";

export default function Home() {
  return (
    <>
      <Head>
        <title>Long-Quan</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main>
        <h1>Hoang-Pham, Long-Quan</h1>
      </main>

      <footer>
        <h1>Something</h1>
      </footer>
    </>
  );
}
